import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Header from './Header'
import Footer from "./Footer";
import Home from "./Home";
import About from "./About";



class App extends Component{
  render(){
    return (
        <Router>
        <div>
          <Header />
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/about">
            <About />
          </Route>
          <Footer />
        </div>
      </Router>



    );
    }
  }


export default App;
